Object(f.a)(JSON.parse('{"ar":{"add_group_set_f9809e11":"إضافة مجموعة مجموعات","groups":{"manage":{"group_categories":{"account_group_explanation":"تعد مجموعات الطلاب على مستوى الحساب طريقة جيدة لتجميع الطلاب دون ربطهم بمساق خاص. بحيث تحصل كل مجموعة طلاب على تقويم ولوحة مناقشة وأدوات تعاون حتى يستطيعوا تنظيم أنفسهم والعمل معًا بفعالية أكبر.","course_group_explanation":"تعد مجموعات الطلاب طريقة مفيدة لتنظيم الطلاب لإنجاز المشروعات أو أوراق المجموعات. بحيث تحصل كل مجموعة طلاب على تقويم ولوحة مناقشة وأدوات تعاون حتى يستطيعوا تنظيم أنفسهم والعمل معًا بفعالية أكبر.","group_assignment_instructions":"يمكنك عشوائيًا تعيين الطلاب إلى مجموعات من حجم خاص، أو إنشاء المجموعات وتنظيمها يدويًا.  وبمجرد أن يتم إنشاء مجموعاتك، يمكنك ضبط مهام بحيث تصبح مهام \\"إرسال المجموعة\\"، مما يعني أن كل مجموعة ستحتوي على كل إرسال واحد لجميع مستخدمي تلك المجموعة.","group_set":"مجموعة المجموعات","headings":{"account_groups":"مجموعات الطلاب على مستوى الحساب","course_groups":"مجموعات الطلاب","groups":"المجموعات"},"tabs":{"everyone":"الجميع"}}}}},"cy":{"add_group_set_f9809e11":"Ychwanegu Set Grwpiau","groups":{"manage":{"group_categories":{"account_group_explanation":"Mae grwpiau myfyrwyr ar lefel cyfrif yn ffordd dda o roi myfyrwyr mewn grwpiau heb orfod cadw at gwrs penodol. Bydd pob grŵp myfyrwyr yn cael ei galendr ei hun, bwrdd trafod ac adnoddau cydweithio er mwyn gallu trefnu eu hunain a chydweithio’n fwy effeithiol.","course_group_explanation":"Mae grwpiau myfyrwyr yn ffordd ddefnyddiol o drefnu myfyrwyr ar gyfer pethau fel papurau neu brosiectau grŵp. Bydd pob grŵp myfyrwyr yn cael ei galendr ei hun, bwrdd trafod ac adnoddau cydweithio er mwyn gallu trefnu eu hunain a chydweithio’n fwy effeithiol.","group_assignment_instructions":"Gallwch neilltuo myfyrwyr ar hap i grwpiau o faint penodol, neu greu a threfnu’r grwpiau eich hun. Ar ôl i’r grwpiau gael eu creu, gallwch osod aseiniadau i fod yn aseiniadau \\"grŵp\\". Bydd hynny\'n golygu bod gan bob grŵp un cyflwyniad ar gyfer holl ddefnyddwyr y grŵp hwnnw.","group_set":"Set Grwpiau","headings":{"account_groups":"Grwpiau myfyrwyr ar lefel cyfrif","course_groups":"Grwpiau Myfyrwyr","groups":"Grwpiau"},"tabs":{"everyone":"Pawb"}}}}},"da":{"add_group_set_f9809e11":"Tilføj gruppesæt","groups":{"manage":{"group_categories":{"account_group_explanation":"Studiegrupper på kontoniveau er en god måde at gruppere studerende uden at de behøver være tilmeldt samme fag. Hver studiegruppe råder over sin egen kalender, diskussionsforum og samarbejdsværktøjer, så de selv kan organisere deres samarbejde på en mere effektiv måde.","course_group_explanation":"Studiegrupper er en god måde at gruppere studerende for ting såsom gruppeprojekter eller opgaver. Hver studiegruppe råder over sin egen kalender, diskussionsforum og samarbejdsværktøjer, så de selv kan organisere deres samarbejde på en mere effektiv måde.","group_assignment_instructions":"Du kan vælge vilkårlige studerende til grupper af en specifik størrelse, eller manuelt oprette og organisere grupperne. Når dine grupper er oprettet, kan du indstille opgaver til at være opgaver med \\"Gruppeaflevering\\", hvilket betyder, at hver gruppe har én aflevering, som gælder for alle medlemmerne i den pågældende gruppe.","group_set":"Gruppesæt","headings":{"account_groups":"Studiegrupper på kontoniveau","course_groups":"Studiegrupper","groups":"Grupper"},"tabs":{"everyone":"Alle"}}}}},"da-x-k12":{"add_group_set_f9809e11":"Tilføj gruppesæt","groups":{"manage":{"group_categories":{"account_group_explanation":"Studiegrupper på kontoniveau er en god måde at gruppere elever uden at de behøver være tilmeldt samme fag. Hver studiegruppe råder over sin egen kalender, diskussionsforum og samarbejdsværktøjer, så de selv kan organisere deres samarbejde på en mere effektiv måde.","course_group_explanation":"Studiegrupper er en god måde at gruppere elever for ting såsom gruppeprojekter eller opgaver. Hver studiegruppe råder over sin egen kalender, diskussionsforum og samarbejdsværktøjer, så de selv kan organisere deres samarbejde på en mere effektiv måde.","group_assignment_instructions":"Du kan vælge vilkårlige elever til grupper af en specifik størrelse eller manuelt oprette og organisere grupperne. Når dine grupper er oprettet, kan du indstille opgaver til at være opgaver med \\"Gruppeaflevering\\", hvilket betyder, at hver gruppe har én aflevering, som gælder for alle medlemmerne i den pågældende gruppe.","group_set":"Gruppesæt","headings":{"account_groups":"Studiegrupper på kontoniveau","course_groups":"Studiegrupper","groups":"Grupper"},"tabs":{"everyone":"Alle"}}}}},"de":{"add_group_set_f9809e11":"Gruppenset hinzufügen","groups":{"manage":{"group_categories":{"account_group_explanation":"Über Studentengruppen auf Benutzerkontoebene können Studenten in Gruppen zusammengefasst werden, ohne diese an einen bestimmten Kurs zu binden. Jede Studentengruppe hat ihren eigenen Kalender, ein Diskussionsforum und Zusammenarbeits-Tools, sodass sich die Gruppenmitglieder selbst organisieren und effektiver zusammenarbeiten können.","course_group_explanation":"Mithilfe von Studentengruppen können Studenten für Gruppenprojekte oder Arbeiten organisiert werden. Jede Studentengruppe hat ihren eigenen Kalender, ein Diskussionsforum und Zusammenarbeits-Tools, sodass sich die Gruppenmitglieder selbst organisieren und effektiver zusammenarbeiten können.","group_assignment_instructions":"Sie können die Studenten nach dem Zufallsprinzip auf Gruppen mit einer bestimmten Mitgliederzahl verteilen oder die Gruppen manuell erstellen und organisieren. Sobald Ihre Gruppen erstellt sind, können Sie Aufgaben zu Aufgaben mit „Gruppenabgabe“ machen, wobei jede Gruppe eine Abgabe für alle Gruppenmitglieder hochlädt.","group_set":"Gruppenset","headings":{"account_groups":"Studentengruppen auf Kontoebene","course_groups":"Studentengruppen","groups":"Gruppen"},"tabs":{"everyone":"Jeder"}}}}},"el":{"add_group_set_f9809e11":"Προσθήκη Σετ Ομάδων","groups":{"manage":{"group_categories":{"account_group_explanation":"\\u003cmrk mid=\\"6515\\" mtype=\\"seg\\"\\u003eΟι ομάδες σπουδαστών σε επίπεδο λογαριασμού είναι ένας καλός τρόπος για να οργανώσετε τους σπουδαστές σε ομάδες χωρίς να δεσμεύεστε για συγκεκριμένο μάθημα.\\u003c/mrk\\u003e \\u003cmrk mid=\\"6516\\" mtype=\\"seg\\"\\u003eΣε κάθε ομάδα σπουδαστών παρέχεται ένα ημερολόγιο, πίνακας συζήτησης και εργαλεία συνεργασίας ώστε οι σπουδαστές να μπορούν να οργανώνονται και να εργάζονται από κοινού πιο αποτελεσματικά.\\u003c/mrk\\u003e","course_group_explanation":"\\u003cmrk mid=\\"6518\\" mtype=\\"seg\\"\\u003eΟι ομάδες σπουδαστών είναι ένας χρήσιμος τρόπος οργάνωσης των σπουδαστών για περιπτώσεις όπως τα ομαδικά πρότζεκτς ή οι εργασίες.\\u003c/mrk\\u003e \\u003cmrk mid=\\"6519\\" mtype=\\"seg\\"\\u003eΣε κάθε ομάδα σπουδαστών παρέχεται ένα ημερολόγιο, πίνακας συζήτησης και εργαλεία συνεργασίας ώστε οι σπουδαστές να μπορούν να οργανώνονται και να εργάζονται από κοινού πιο αποτελεσματικά.\\u003c/mrk\\u003e","group_assignment_instructions":"\\u003cmrk mid=\\"6520\\" mtype=\\"seg\\"\\u003eΜπορείτε να ορίσετε τυχαία σπουδαστές σε ομάδες συγκεκριμένου μεγέθους ή να δημιουργήσετε και να οργανώσετε χειροκίνητα τις ομάδες.\\u003c/mrk\\u003e \\u003cmrk mid=\\"6521\\" mtype=\\"seg\\"\\u003eΜόλις δημιουργηθούν οι ομάδες, μπορείτε να ορίσετε εργασίες ως εργασίες «ομαδικής υποβολής», που σημαίνει ότι κάθε ομάδα θα διαθέτει μία υποβολή για όλους τους χρήστες της.\\u003c/mrk\\u003e","group_set":"Σετ Ομάδων","headings":{"account_groups":"Ομάδες Σπουδαστών σε Επίπεδο Λογαριασμού","course_groups":"Ομάδες Μαθητών","groups":"Ομάδες"},"tabs":{"everyone":"Όλοι/ες"}}}}},"en-AU":{"add_group_set_f9809e11":"Add Group Set","groups":{"manage":{"group_categories":{"account_group_explanation":"Account-level student groups are a good way to group students without being tied to a specific course. Every student group gets their own calendar, discussion board and collaboration tools so they can organize themselves and work together more effectively.","course_group_explanation":"Student groups are a useful way to organize students for things like group projects or papers. Every student group gets their own calendar, discussion board and collaboration tools so they can organize themselves and work together more effectively.","group_assignment_instructions":"You can randomly assign students to groups of a specific size, or manually create and organize the groups. Once your groups are created, you can set assignments to be \\"group submission\\" assignments, which means each group will have one submission for all users of that group.","group_set":"Group Set","headings":{"account_groups":"Account-level Student Groups","course_groups":"Student Groups","groups":"Groups"},"tabs":{"everyone":"Everyone"}}}}},"en-CA":{"add_group_set_f9809e11":"Add Group Set","groups":{"manage":{"group_categories":{"account_group_explanation":"Account-level student groups are a good way to group students without being tied to a specific course. Every student group gets their own calendar, discussion board and collaboration tools so they can organize themselves and work together more effectively.","course_group_explanation":"Student groups are a useful way to organize students for things like group projects or papers. Every student group gets their own calendar, discussion board and collaboration tools so they can organize themselves and work together more effectively.","group_assignment_instructions":"You can randomly assign students to groups of a specific size, or manually create and organize the groups. Once your groups are created, you can set assignments to be \\"group submission\\" assignments, which means each group will have one submission for all users of that group.","group_set":"Group Set","headings":{"account_groups":"Account-level Student Groups","course_groups":"Student Groups","groups":"Groups"},"tabs":{"everyone":"Everyone"}}}}},"en-GB":{"add_group_set_f9809e11":"Add group set","groups":{"manage":{"group_categories":{"account_group_explanation":"Account-level student groups are a good way to group students without being tied to a specific course. Every student group gets their own calendar, discussion board and collaboration tools so they can organise themselves and work together more effectively.","course_group_explanation":"Student groups are a useful way to organise students for things like group projects or papers. Every student group gets their own calendar, discussion board and collaboration tools so they can organise themselves and work together more effectively.","group_assignment_instructions":"You can randomly assign students to groups of a specific size, or manually create and organise the groups. Once your groups are created, you can set assignments to be \\"group submission\\" assignments, which means each group will have one submission for all users of that group.","group_set":"Group set","headings":{"account_groups":"Account-level student groups","course_groups":"Student groups","groups":"Groups"},"tabs":{"everyone":"Everyone"}}}}},"es":{"add_group_set_f9809e11":"Agregar conjunto de grupos","groups":{"manage":{"group_categories":{"account_group_explanation":"Las cuentas de grupos de estudiantes son una buena forma de agrupar estudiantes sin enlazarlos a ningún curso específico. Cada grupo de estudiantes tendrá su propio calendario, foro de discusión y herramientas de colaboración para que puedan organizarse y trabajar más eficientemente.","course_group_explanation":"Los grupos de estudiantes son una buena forma de organizar a los estudiantes para tareas como proyectos o ensayos. Cada grupo de estudiantes tendrá su propio calendario, foro de discusión y herramientas de colaboración para que puedan organizarse y trabajar más eficientemente.","group_assignment_instructions":"Puede agrupar a los estudiantes al azar en grupos de un tamaño específico o crearlos y organizarlos manualmente. Una vez que se hayan creado los grupos, puede configurar que las tareas sean \\"entregas grupales\\", lo que significa que cada grupo realizará una sola entrega que agrupará a todos los usuarios de ese grupo.","group_set":"Conjunto de grupos","headings":{"account_groups":"Grupos de estudiantes a nivel de cuenta","course_groups":"Grupos de estudiantes","groups":"Grupos"},"tabs":{"everyone":"Todos"}}}}},"fa":{"add_group_set_f9809e11":"افزودن مجموعه گروه","groups":{"manage":{"group_categories":{"account_group_explanation":"گروه های دانشجویی در سطح حساب، روش خوبی برای گروه بندی دانشجویان بدون داشتن وابستگی به یک درس خاص هستند. هر گروه دانشجویی تقویم، صفحه بحث و ابزارهای همکاری مخصوص به خود را دریافت می کند تا بتواند خود را سازماندهی کند و به طور مؤثرتر با گروه های دیگر همکاری نماید.","course_group_explanation":"گروه های دانشجویی روش مفیدی برای سازماندهی دانشجویان برای چیزهایی مانند پروژه ها یا مقاله های گروهی هستند. هر گروه دانشجویی تقویم، صفحه بحث و ابزارهای همکاری مخصوص به خود را دریافت می کند تا بتواند خود را سازماندهی کند و با گروه های دیگر به طور مؤثرتر همکاری نماید. ","group_assignment_instructions":"می توانید دانشجویان را به طور تصادفی به گروهایی با یک اندازه خاص تخصیص دهید، یا گروه ها را به طور دستی ایجاد و سازماندهی کنید. وقتی گروه های شما ایجاد شدند، می توانید تکلیف ها را به عنوان تکلیف های «ارسالی گروه» تعیین کنید، بدین معنا که هر گروه یک مورد ارسالی برای همه کاربران این گروه خواهد داشت.","group_set":"مجموعه گروه","headings":{"account_groups":"گروه های دانشجویی در سطح حساب","course_groups":"گروه‌های دانشجویی","groups":"گروه ها"},"tabs":{"everyone":"همه"}}}}},"fi":{"add_group_set_f9809e11":"Lisää ryhmän määritykset","groups":{"manage":{"group_categories":{"account_group_explanation":"Tilin tason opiskelijaryhmät ovat hyvä tapa ryhmittää opiskelijat ilman, että oltaisiin sidottuja määrättyyn kurssiin. Jokainen opiskelijaryhmä saa oman kalenterin, keskustelutaulun ja työkalut yhteistyöhön, niin että he voivat järjestäytyä ja tehdä yhteistyötä tehokkaasti.","course_group_explanation":"Opiskelijaryhmät ovat hyödyllinen tapa organisoida opiskelijat esim. ryhmäprojekteihin tai testeihin. Jokainen opiskelijaryhmä saa oman kalenterin, keskustelutaulun ja työkalut yhteistyöhön, niin että he voivat järjestäytyä ja tehdä yhteistyötä tehokkaasti.","group_assignment_instructions":"Voit kohdistaa opiskelijoita satunnaisesti määrätyn kokoisiin ryhmiin tai luoda ja organisoida manuaalisesti ryhmiin. Kun ryhmät on luotu, voit määrittää tehtävät ”ryhmälähetys”-tehtäviksi, mikä tarkoittaa, että jokaisella ryhmällä on yksi lähetys kaikille käyttäjille kyseisessä ryhmässä.","group_set":"Ryhmäjoukko","headings":{"account_groups":"Tilin tason opiskelijaryhmät","course_groups":"Opiskelijaryhmät","groups":"Ryhmät"},"tabs":{"everyone":"Kaikki"}}}}},"fr":{"add_group_set_f9809e11":"Ajouter un ensemble de groupes","groups":{"manage":{"group_categories":{"account_group_explanation":"Les groupes d’étudiants créés au niveau du compte représentent un bon moyen de créer des groupes sans être lié à un cours donné. Chaque groupe d’étudiants reçoit son calendrier, son tableau de discussion et ses outils de collaboration afin de s’organiser et de travailler ensemble plus efficacement.","course_group_explanation":"Les groupes sont très utiles pour organiser les étudiants autour d’activités telles que des projets ou des essais de groupe. Chaque groupe d’étudiants reçoit son calendrier, son tableau de discussion et ses outils de collaboration afin de s’organiser et de travailler ensemble plus efficacement.","group_assignment_instructions":"Vous pouvez attribuer des étudiants aléatoirement dans des groupes de taille spécifique, ou créer et organiser des groupes manuellement. Une fois que vos groupes sont créés, vous pouvez définir les tâches comme étant des envois groupés, ce qui signifie que chaque groupe fera un seul envoi pour tous les utilisateurs du groupe.","group_set":"Ensemble de groupes","headings":{"account_groups":"Groupes d’étudiants au niveau compte","course_groups":"Groupes d’étudiants","groups":"Groupes"},"tabs":{"everyone":"Tous"}}}}},"fr-CA":{"add_group_set_f9809e11":"Ajouter un ensemble de groupes","groups":{"manage":{"group_categories":{"account_group_explanation":"Les groupes d’étudiants créés au niveau du compte représentent un bon moyen de créer des groupes sans être lié à un cours donné. Chaque groupe d’étudiants reçoit son calendrier, son tableau de discussion et ses outils de collaboration afin de s’organiser et de travailler ensemble plus efficacement.","course_group_explanation":"Les groupes d’étudiants sont très utiles pour organiser les étudiants autour d’activités telles que des projets ou des essais de groupe. Chaque groupe d’étudiants reçoit son calendrier, son tableau de discussion et ses outils de collaboration afin de s’organiser et de travailler ensemble plus efficacement.","group_assignment_instructions":"Vous pouvez attribuer des étudiants aléatoirement dans des groupes de taille spécifique, ou créer et organiser des groupes manuellement. Une fois que vos groupes sont créés, vous pouvez définir les tâches comme des tâches « d’envoi groupé », ce qui signifie que chaque groupe fera un envoi pour tous les utilisateurs du groupe.","group_set":"Ensemble de groupes","headings":{"account_groups":"Groupes d’étudiants au niveau compte","course_groups":"Groupes d’étudiants","groups":"Groupes"},"tabs":{"everyone":"Tous"}}}}},"he":{"add_group_set_f9809e11":"הוספת אוסף קבוצות","groups":{"manage":{"group_categories":{"account_group_explanation":"קבוצות תלמידים ברמת החשבון הנן דרך טובה לקבץ תלמידים ללא הצורך בייחוס לקורס מסויים. כל קבוצת תלמידים מקבלת יומן משלה, קבוצת דיון וכלי שיתוף כדי שיוכלו לארגן את עצמם ולעבוד יחדיו בצורה יעילה יותר. ","course_group_explanation":"קבוצות תלמידים הנן דרך יעילה לארגן תלמידים לפעילות כמו קבוצת פרויקט או כתיבת עבודה. כל קבוצת תלמידים מקבלת יומן פרטי, לוח דיונים וכלי שיתוף כדי לארגן לעצמה את העבודה המשותפת בדרך יותר יעילה.","group_assignment_instructions":"ניתן להקצות באופן אקראי תלמידים לקבוצות בעלות גודל מוגדר, או ידנית ליצור ולארגן את הקבוצות. לאחר יצירתן, ניתן להגדיר משימות קבוצה ל\\"הגשה קבוצתית\\", שמשמעו שכל קבוצה תגיש הגשה משותפת אחת עבור כל חברי הקבוצה. ","group_set":"אוסף קבוצות","headings":{"account_groups":"קבוצות תלמידים ברמת החשבון ","course_groups":"קבוצות תלמידים ","groups":"קבוצות"},"tabs":{"everyone":"כל אחד"}}}}},"ht":{"add_group_set_f9809e11":"Ajoute Ansanm Gwoup","groups":{"manage":{"group_categories":{"account_group_explanation":"Gwoup elèv nivo kont yo se bon fason pou gwoupe elèv yo san yo pa lye a yon kou patikilye. Chak gwoup elèv gen pwòp kalandriye pa yo, tablo diskisyon pa yo e enstriman kolaborasyon pa yo pou yo ka òganize yo e travay ansanm pi byen.","course_group_explanation":"Gwoup elèv yo se mwayen ki itil pou òganize elèv yo pou bagay tankou pwojè an gwoup oswa papye. Chak gwoup elèv gen pwòp kalandriye pa yo, tablo diskisyon pa yo e enstriman kolaborasyon pa yo pou yo ka òganize yo e travay ansanm pi byen.","group_assignment_instructions":"Ou ka mete elèv yo nan gwoup a yon dimansyon patikilye pa aza, oswa kreye a la men epi òganize gwoup yo. Lè gwoup ou yo fin kreye, ou ka defini sesyon ki pou sesyon \\"soumisyon gwoup\\", sa ki vle di chak gwoup ap gen yon soumisyon pou tout itilizatè gwoup sa a.","group_set":"Ansanm Gwoup","headings":{"account_groups":"Gwoup Elèv Nivo Kont","course_groups":"Gwoup Elèv","groups":"Gwoup"},"tabs":{"everyone":"Tout Moun"}}}}},"hu":{"add_group_set_f9809e11":"Csoporthalmaz hozzáadása","groups":{"manage":{"group_categories":{"account_group_explanation":"A fiókszintű hallgatói csoportok hasznosak a hallgatók csoportosítására, konkrét kurzushoz való társítás nélkül. Minden hallgatói csoporthoz saját naptár, fórum és együttműködési eszközök tartoznak, így hatékonyabban tudják megszervezni a közös munkát.","course_group_explanation":"A hallgatói csoportok kialakítása hasznos módja annak, hogy projektekben működjenek együtt a hallgatók. Minden hallgatói csoport rendelkezik saját naptárral, fórummal és együttműködési eszközökkel, így hatékonyabban tudják megszervezni a közös munkát.","group_assignment_instructions":"A hallgatókat be tudja osztani véletlenszerűen csoportokba, vagy kézzel létrehozhatja és rendszerezheti a csoportokat. Amint létrejöttek a csoportok, beállíthatja a feladatokat úgy, hogy \\"csoportos beadandó\\" feladatok legyenek, ami azt jelenti, hogy minden egyes csoportnak egy beküldött megoldása lesz, mely a csoportbeli tagok közös megoldása.","group_set":"Csoporthalmaz","headings":{"account_groups":"Fiókszintű hallgatói csoportok","course_groups":"Hallgatói csoportok","groups":"Csoportok"},"tabs":{"everyone":"Mindenki"}}}}},"hy":{"add_group_set_f9809e11":"Ավելացնել խմբերի շարք","groups":{"manage":{"group_categories":{"account_group_explanation":"Միևնույն հաշիվն ունեցող ունկնդիրների խմբերը գերազանց միջոց են խմբավորելու ունկնդիրներին՝ առանց կապված լինելու որոշակի դասընթացի: Ունկնդիրների ամեն խումբ ստանում է իր սեփական օրացույցը, քննարկման տախտակը և համատեղ աշխատելու գործիքներ, այնպես որ նրանք կարող են կազմակերպվել ինքնուրույն և ավելի արդյունավետ աշխատել միմյանց հետ:  ","course_group_explanation":"Ունկնդիրների խմբերը օգտակար միջոց են կազմակերպելու ունկնդիրներին խմբային նախագծերի կամ փաստաթղթերի վրա աշխատելու համար: Ունկնդիրների ամեն խումբ ստանում է իր սեփական օրացույցը, քննարկման տախտակը և համատեղ աշխատելու գործիքներ, այնպես որ նրանք կարող են կազմակերպվել ինքնուրույն և ավելի արդյունավետ աշխատել միմյանց հետ:  ","group_assignment_instructions":"Դուք կարող եք ունկնդիրներին պատահական ձևով բաժանել որոշակի խմբերի կամ մեխանիկական եղանակով ստեղծել և կազմակերպել խմբեր: Խմբերը ստեղծելուց հետո կարող եք հանձնարարությունները սահմանել որպես \\"խմբի կողմից ներկայացվող\\", որը նշանակում է, որ յուրաքանչյուր խումբ կունենա տվյալ հանձնարարության հետ կապված մեկ աշխատանք այդ խմբի բոլոր օգտատերերի համար: ","group_set":"Խմբերի շարք","headings":{"account_groups":"Միևնույն հաշիվ ունեցող ունկնդիրների խմբեր","course_groups":"Ունկնդիրների խմբեր","groups":"Խմբեր"},"tabs":{"everyone":"Յուրաքանչյուրը"}}}}},"is":{"add_group_set_f9809e11":"Bæta við hópasetti","groups":{"manage":{"group_categories":{"account_group_explanation":"Nemendahópar á reikningsstigi eru góð leið til að hópa nemendur án þess að binda þá við ákveðið námskeið. Allir nemendahópar fá dagatal, umræðuborð og samvinnutól til að geta skipulagt sig og unnið betur saman.","course_group_explanation":"Nemendahópar eru góð leið til að skipuleggja nemendur fyrir hluti eins og hópverkefni eða ritgerðir. Allir nemendahópar fá dagatal, umræðuborð og samvinnutól til að geta skipulagt sig og unnið betur saman.","group_assignment_instructions":"Hægt er að slembitilnefna nemendur í hópa í tiltekinni stærð eða stofna og skipuleggja hópana handvirkt. Þegar hópar hafa verið stofnaðir er hægt að ákveða verkefni sem \\"hópverkefni\\" sem þýðir að hver hópur hefur ein skil fyrir alla notendur hópsins.","group_set":"Hópasett","headings":{"account_groups":"Nemendahópar á reikningsstigi","course_groups":"Nemendahópar","groups":"Hópar"},"tabs":{"everyone":"Allir"}}}}},"it":{"add_group_set_f9809e11":"Aggiungi set di gruppi","groups":{"manage":{"group_categories":{"account_group_explanation":"I gruppi di studenti a livello di account sono un ottimo modo per raggruppare gli studenti senza essere legati a un corso specifico. Ciascun gruppo di studenti riceve un calendario, un\'area discussioni e strumenti di collaborazione per consentire loro di organizzarsi e collaborare in maniera più efficace.","course_group_explanation":"I gruppi di studenti sono un modo utile per organizzare gli studenti per iniziative quali elaborati o progetti di gruppo. Ciascun gruppo di studenti riceve un calendario, un\'area discussioni e strumenti di collaborazione per consentire loro di organizzarsi e collaborare in maniera più efficace.","group_assignment_instructions":"Puoi assegnare in maniera casuale gli studenti a gruppi di dimensioni specifiche o creare e organizzare i gruppi manualmente. Un volta creati i tuoi gruppi, puoi impostare i compiti come \\"consegne di gruppo\\". Ciò significa che ciascun gruppo avrà una consegna per tutti gli utenti del gruppo.","group_set":"Set di gruppi","headings":{"account_groups":"Gruppi di studenti a livello di account","course_groups":"Gruppi di studenti","groups":"Gruppi"},"tabs":{"everyone":"Tutti"}}}}},"ja":{"add_group_set_f9809e11":"グループ セットの追加","groups":{"manage":{"group_categories":{"account_group_explanation":"アカウント レベルの受講生グループは、受講生を特定のコースに関連付けずにグループ化するための便利な方法です。すべての受講生グループにグループ専用のカレンダー、掲示板、および共同作用ツールが提供されるため、受講生が自らグループを管理でき、より効率的に共同作業を行うことができます。","course_group_explanation":"受講生グループは、グループ プロジェクトやグループ論文などのために受講生を組織化する際に役立ちます。すべての受講生グループにグループ専用のカレンダー、掲示板、および共同作用ツールが提供されるため、受講生が自らグループを管理でき、より効率的に共同作業を行うことができます。","group_assignment_instructions":"指定したサイズのグループに受講生を無作為に割り当てることも、手動でグループを作成して編成することもできます。グループを作成すると、\\"グループ提出\\" の課題 (グループ全体で 1 つの提出物を作成する課題) を設定できます。","group_set":"グループ セット","headings":{"account_groups":"アカウント レベルの受講生グループ","course_groups":"受講生グループ","groups":"グループ"},"tabs":{"everyone":"全員"}}}}},"ko":{"add_group_set_f9809e11":"그룹 집합 추가","groups":{"manage":{"group_categories":{"account_group_explanation":"계정 수준 학생 그룹은 특정 과목에 묶이지 않은 학생을 묶는 좋은 방법입니다. 모든 학생 그룹은 자신의 달력, 토론장, 협업 도구를 가지고 있어서 스스로 구성하고 보다 효율적으로 함께 작업할 수 있습니다.","course_group_explanation":"학생 그룹은 그룹 프로젝트나 보고서를 위해 학생을 구성하는 유용한 방법입니다. 모든 학생 그룹은 별도의 달력과 토론 보드와 협업 도구가 있어서 스스로 조직하고 더 효과적으로 함께 일할 수 있습니다.","group_assignment_instructions":"학생을 임의로 정해진 크기의 그룹에 할당하거나 수동으로 그룹을 만들고 구성할 수 있습니다. 그룹을 만들면 과제를 \\"그룹 제출\\" 과제로 만들 수 있는데, 그러면 각 그룹은 그룹의 모든 사용자에 대한 하나의 제출물을 갖게 됩니다.","group_set":"그룹 집합","headings":{"account_groups":"계정 수준 학생 그룹","course_groups":"학생 그룹","groups":"그룹"},"tabs":{"everyone":"모두"}}}}},"mi":{"add_group_set_f9809e11":"Tāpiri Tautuhi Rōpū","groups":{"manage":{"group_categories":{"account_group_explanation":"He huarahi pai ngā rōpū akonga taumata-pae hei whakakao ākonga kāhore ō rātou hononga-ā-kaupapa. Ka whai rātaka ia rōpū, papa kōrero me ētahi rauemi mahi-ā-rōpū kia pai ai te whakariterite i a rātou anō me te mahi ngātahi hoki.","course_group_explanation":"Rōpū ākonga ko te ara whai hua ki te whakarite ngā ākonga mō mea rite kaupapa rānei pepa rōpū. Whiwhi nga rōpū ākonga ratou taputapu ake maramataka, te poari kōrero me te mahi tahi kia taea e ratou te whakarite ia ratou, ka mahi tahi atu tōtika.","group_assignment_instructions":"Matapōkeretia koe e taea e tautapa ākonga ki ngā rōpū o te rahi motuhake, rānei ā-waihanga me te whakarite i te rōpū. Kia e hanga koutou rōpū, ka taea e whakaturia e koe whakataunga ia riro mau whakataunga \\"tāpaetanga rōpū\\", i te tikanga e whai ia rōpū kotahi tāpaetanga mō ngā kaiwhakamahi katoa o taua rōpū.","group_set":"Tautuhi rōpū","headings":{"account_groups":"Taumata-pae Rōpū Akonga","course_groups":"Ngā rōpū Ākonga","groups":"Ngā rōpū"},"tabs":{"everyone":"tāngata katoa"}}}}},"nb":{"add_group_set_f9809e11":"Legg til gruppesett","groups":{"manage":{"group_categories":{"account_group_explanation":"Studentgrupper på kontonivå er en god måte å gruppere studenter på uten å være bundet til et spesifikt emne. Hver studentgruppe får sin egen kalender, diskusjonsforum og samarbeidsverktøy så de kan organisere seg selv og samarbeide mer effektivt.","course_group_explanation":"Studentgrupper er en nyttig måte å organisere studentene for saker som gruppeprosjekter eller oppgaver. Hver studentgruppe får sin egen kalender, diskusjonsforum og samarbeidsverktøy så de kan organisere seg selv og samarbeide mer effektivt.","group_assignment_instructions":"Du kan vilkårlig fordele studenter til grupper med en bestemt størrelse, eller manuelt opprette og organisere gruppene. Når gruppene er opprettet kan du sette oppgaver til å være \\"gruppeinnleveringer\\", hvilket betyr at hver gruppe har én innlevering for alle brukerne i gruppen.","group_set":"Gruppesett","headings":{"account_groups":"Studentgrupper på konto-nivå","course_groups":"Studentgrupper","groups":"Grupper"},"tabs":{"everyone":"Alle"}}}}},"nb-x-k12":{"add_group_set_f9809e11":"Legg til gruppesett","groups":{"manage":{"group_categories":{"account_group_explanation":"Elevgrupper på kontonivå er en god måte å gruppere elever på uten å være bundet til et spesifikt fag. Hver elevgruppe får sin egen kalender, diskusjonsforum og samarbeidsverktøy så de kan organisere seg selv og samarbeide mer effektivt.","course_group_explanation":"Elevgrupper er en nyttig måte å organisere elevene for saker som gruppeprosjekter eller oppgaver. Hver elevgruppe får sin egen kalender, diskusjonsforum og samarbeidsverktøy så de kan organisere seg selv og samarbeide mer effektivt.","group_assignment_instructions":"Du kan vilkårlig fordele elever til grupper med en bestemt størrelse, eller manuelt opprette og organisere gruppene. Når gruppene er opprettet kan du sette oppgaver til å være \\"gruppeinnleveringer\\", hvilket betyr at hver gruppe har én innlevering for alle brukerne i gruppen.","group_set":"Gruppesett","headings":{"account_groups":"Elevgrupper på konto-nivå","course_groups":"Elevgrupper","groups":"Grupper"},"tabs":{"everyone":"Alle"}}}}},"nl":{"add_group_set_f9809e11":"Groepsreeks toevoegen","groups":{"manage":{"group_categories":{"account_group_explanation":"Groepen cursisten op accountniveau zijn een goede manier om groepen te maken die niet aan een specifieke cursus gebonden zijn. Elke groep cursisten krijgt zijn eigen kalender, discussieforum en andere samenwerkingsmiddelen, dus kunnen zij zichzelf indelen en effectiever samenwerken.","course_group_explanation":"Groepen cursisten zijn een goede manier om cursisten te organiseren voor zaken zoals groepsprojecten of papers. Elke groep cursisten krijgt zijn eigen kalender, discussieforum en andere samenwerkingsmiddelen, dus kunnen zij zichzelf indelen en effectiever samenwerken.","group_assignment_instructions":"Je kunt cursisten willekeurig toewijzen aan groepen van een specifieke grootte of je kunt handmatig groepen maken en indelen. Eens jouw groepen gemaakt zijn, kun je opdrachten instellen als \\"groepsinzending\\" opdrachten, wat inhoudt dat elke groep een opdracht zal inleveren namens alle leden van die groep.","group_set":"Groepsreeks","headings":{"account_groups":"Groepen cursisten op accountniveau","course_groups":"Groepen cursisten","groups":"Groepen"},"tabs":{"everyone":"Iedereen"}}}}},"nn":{"add_group_set_f9809e11":"Legg til gruppesett","groups":{"manage":{"group_categories":{"account_group_explanation":"Studentgrupper på kontonivå er ein bra måte å gruppere studentar på utan å vere tilknytt eit bestemt emne. Kvar studentgruppe får eigen kalender, diskusjonstavle og samarbeidsverktøy slik at dei kan organisere seg og samarbeide meir effektivt.","course_group_explanation":"Studentgrupper er nyttige når ein skal organisere aktivitetar som gruppeprosjekt og eksamensoppgåver. Kvar studentgruppe får eigen kalender, diskusjonstavle og samarbeidsverktøy slik at dei kan organisere seg og samarbeide meir effektivt.","group_assignment_instructions":"Du kan tilordne studentar tilfeldig til grupper med ein bestemt storleik, eller opprette og organisere gruppene manuelt. Når gruppene er oppretta, kan du oppgi oppgåver til å vere \\"gruppeinnleveringar\\", som betyr at kvar gruppe har ei innlevering for alle brukarane av gruppa.","group_set":"Gruppesett","headings":{"account_groups":"Studentgrupper på kontonivå","course_groups":"Studentgrupper","groups":"Grupper"},"tabs":{"everyone":"Alle"}}}}},"pl":{"add_group_set_f9809e11":"Dodaj zestaw grup","groups":{"manage":{"group_categories":{"account_group_explanation":"Grupy uczestników na poziomie kont to dobry sposób na podzielenie uczestników bez przypisywania do konkretnych kursów. Każda grupa uczestników otrzymuje własny kalendarz, tablicę ogłoszeniową i narzędzia umożliwiające realizację projektów współpracy, skuteczniejszą organizację i pracę w grupie.","course_group_explanation":"Grupy uczestników to dobry sposób na zorganizowanie uczestników w celu pracy nad projektami grupowymi czy zadaniami. Każda grupa uczestników otrzymuje własny kalendarz, tablicę ogłoszeniową i narzędzia umożliwiające realizację projektów współpracy, skuteczniejszą organizację i pracę w grupie.","group_assignment_instructions":"`Możesz losowo przydzielić uczestników do grup o określonej liczebności lub ręcznie utworzyć i zorganizować grupy. Gdy grupy zostaną utworzone, możesz ustawić zadania, które będą „zadaniami przesyłanymi grupowo”, co oznacza, że każda z grup będzie musiała przesłać jedno zadanie dla wszystkich użytkowników znajdujących się w danej grupie.","group_set":"Zestaw grup","headings":{"account_groups":"Grupy uczestników na poziomie kont","course_groups":"Grupy uczestników","groups":"Grupy"},"tabs":{"everyone":"Wszyscy"}}}}},"pt":{"add_group_set_f9809e11":"Adicionar conjunto de grupos","groups":{"manage":{"group_categories":{"account_group_explanation":"Os grupos de alunos no nível da conta são uma boa maneira de agrupar alunos sem estar preso a uma disciplina específica. Todos os grupos de alunos obtêm o seu próprio calendário, quadro de discussão e ferramentas de colaboração, para que se possam organizar sozinhos e trabalhar em grupo mais eficientemente.","course_group_explanation":"Os grupos de alunos são uma forma útil de organizar alunos para projetos em grupo ou artigos. Todos os grupos de alunos obtêm o seu próprio calendário, quadro de discussão e ferramentas de colaboração, para que se possam organizar sozinhos e trabalhar em grupo mais eficientemente.","group_assignment_instructions":"Pode atribuir aleatoriamente os alunos a grupos de um tamanho específico ou criar e organizar manualmente os grupos. Após a criação dos grupos, pode definir tarefas para serem \\"tarefas de envio em grupo\\", o que significa que cada grupo terá uma tarefa enviada em nome de todos os utilizadores do grupo.","group_set":"Conjunto de grupos","headings":{"account_groups":"Grupos de alunos no nível da conta","course_groups":"Grupos de alunos","groups":"Grupos"},"tabs":{"everyone":"Todos"}}}}},"pt-BR":{"add_group_set_f9809e11":"Adicionar conjunto de grupos","groups":{"manage":{"group_categories":{"account_group_explanation":"Os grupos de aluno no nível da conta são uma boa maneira de agrupar alunos sem estar preso a um curso específico. Todos os grupos de alunos obtêm seu próprio calendário, quadro do fórum e ferramentas de colaboração, de forma que eles possam se organizar sozinhos e trabalhar em grupo mais eficientemente.","course_group_explanation":"Grupos de alunos são uma forma útil de organizar alunos para projetos em grupo ou artigos. Todos os grupos de alunos obtêm seu próprio calendário, quadro do fórum e ferramentas de colaboração, de forma que eles possam se organizar sozinhos e trabalhar em grupo mais eficientemente.","group_assignment_instructions":"É possível atribuir aleatoriamente os alunos a grupos de um tamanho específico ou criar e organizar manualmente os grupos. Uma vez que os grupos forem criados, será possível definir tarefas para serem \\"tarefas de envio em grupo\\", que significa que cada grupo terá uma tarefa enviada em nome de todos os usuários do grupo.","group_set":"Conjunto de grupo","headings":{"account_groups":"Grupos de alunos no nível da conta","course_groups":"Grupos de alunos","groups":"Grupos"},"tabs":{"everyone":"Todo mundo"}}}}},"ru":{"add_group_set_f9809e11":"Добавить набор групп","groups":{"manage":{"group_categories":{"account_group_explanation":"Группы студентов уровня учетной записи — хороший способ группирования студентов без привязки к определенному курсу. Каждая группа студентов получает собственный календарь, доску обсуждений и инструменты совместной работы, чтобы они могли самостоятельно объединяться в группы и более эффективно работать совместно.","course_group_explanation":"Группы студентов — полезный способ объединения студентов для групповых проектов или документации. Каждая группа студентов получает собственный календарь, доску обсуждений и инструменты совместной работы, чтобы они могли самостоятельно объединяться в группы и более эффективно работать совместно.","group_assignment_instructions":"Можно случайным образом распределять студентов по группам определенного размера или создать и организовать группы вручную. После создания групп можно назначить задания как \\"групповые отправки\\". Это означает, что каждая группа будет иметь одну отправку для всех пользователей этой группы.","group_set":"Набор групп","headings":{"account_groups":"Группы студентов уровня учетной записи","course_groups":"Группы студентов","groups":"Группы"},"tabs":{"everyone":"Все"}}}}},"sl":{"add_group_set_f9809e11":"Dodaj nabor skupin","groups":{"manage":{"group_categories":{"account_group_explanation":"Skupine študentov na ravni računa so dober način združevanja študentov v skupine, ne da bi bili vezani na določen predmet. Vsaki skupini študentov so dodeljeni lasten koledar, tabla za razprave in orodja za sodelovanje, tako da se lahko učinkoviteje organizirajo in sodelujejo.","course_group_explanation":"Skupine študentov so uporabne pri organiziranju študentov za projekte skupine ali pisne izdelke. Vsaki skupini študentov so dodeljeni lasten koledar, tabla za razprave in orodja za sodelovanje, tako da se lahko učinkoviteje organizirajo in sodelujejo.","group_assignment_instructions":"Študente lahko naključno dodeljujete skupinam določene velikosti ali pa skupine ročno ustvarjate in organizirate. Ko so skupine ustvarjene, lahko nastavite naloge kot naloge z »oddajo izdelka skupine«, kar pri vsaki skupini pomeni eno oddajo za vse uporabnike te skupine.","group_set":"Nabor skupin","headings":{"account_groups":"Skupine študentov na ravni računa","course_groups":"Skupine študentov","groups":"Skupine"},"tabs":{"everyone":"Vsi"}}}}},"sv":{"add_group_set_f9809e11":"Lägg till gruppuppsättning","groups":{"manage":{"group_categories":{"account_group_explanation":"Studentgrupper på kontonivå är ett bra sätt att gruppera studenter utan att vara bunden till en viss kurs. Varje studentgrupp får sin egen kalender, plats för diskussioner och verktyg för samarbeten som kan användas för att organisera sig själva samt effektivisera sina samarbeten.","course_group_explanation":"Studentgrupper är ett praktiskt sätt att organisera studenter på  för saker som grupparbeten och projekt. Varje studentgrupp får sin egen kalender, plats för diskussioner och verktyg för samarbeten som kan användas för att organisera sig själva samt effektivisera sina samarbeten.","group_assignment_instructions":"Du kan slumpmässigt tilldela studentgrupper av särskilda storlekar, eller skapa och organisera grupper manuellt. Efter att du har skapat en grupp kan du skapa en uppgift som en \\"gruppinlämning\\", vilket betyder att varje grupp kommer ha en inlämning för alla användare i gruppen.","group_set":"Gruppuppsättning","headings":{"account_groups":"Studentgrupper på kontonivå","course_groups":"Studentgrupper","groups":"Grupper"},"tabs":{"everyone":"Alla"}}}}},"sv-x-k12":{"add_group_set_f9809e11":"Lägg till gruppuppsättning","groups":{"manage":{"group_categories":{"account_group_explanation":"Elevgrupper på kontonivå är ett bra sätt att gruppera elever utan att vara bunden till en viss kurs. Varje elevgrupp får sin egen kalender, plats för diskussioner och verktyg för samarbeten som kan användas för att organisera sig själva samt effektivisera sina samarbeten.","course_group_explanation":"Elevgrupper är ett praktiskt sätt att organisera elever på  för saker som grupparbeten och projekt. Varje elevgrupp får sin egen kalender, plats för diskussioner och verktyg för samarbeten som kan användas för att organisera sig själva samt effektivisera sina samarbeten.","group_assignment_instructions":"Du kan slumpmässigt tilldela elevgrupper av särskilda storlekar, eller skapa och organisera grupper manuellt. Efter att du har skapat en grupp kan du skapa en uppgift som en \\"gruppinlämning\\", vilket betyder att varje grupp kommer ha en inlämning för alla användare i gruppen.","group_set":"Gruppuppsättning","headings":{"account_groups":"Elevgrupper på kontonivå","course_groups":"Elevgrupper","groups":"Grupper"},"tabs":{"everyone":"Alla"}}}}},"tr":{"add_group_set_f9809e11":"Grup Ayarı Ekle","groups":{"manage":{"group_categories":{"account_group_explanation":"Hesap düzeyi öğrenci grupları, öğrencileri belirli bir derse bağlamadan gruplama yöntemidir. Her öğrenci grubunun kendi takvimi, tartışma panosu ve işbirliği araçları vardır. Bu sayede, kendilerini organize edip birlikte daha etkili çalışabilirler.","course_group_explanation":"Öğrenci grupları, öğrencilerin grupça projelerini ve taslaklarını organize etmenin kullanışlı bir yoludur. Grup içerisindeki her bir öğrenci kendi takvimine, tartışma alanına ve işbirliği araçları ile daha efektif bir şekilde çalışmayı amaçlar.","group_assignment_instructions":"Belirli büyüklükteki gruplara öğrencileri rasgele atayabilirsiniz ya da grupları manuel olarak oluşturup düzenleyebilirsiniz. Gruplarınız oluşturulduktan sonra ödevleri \\"grup gönderimi\\" ödevleri olarak ayarlayabilirsiniz. Bu durumda her grup, o gruptaki üyeler için bir gönderi yapabilir.","group_set":"Grup Ayarı","headings":{"account_groups":"Hesap düzeyi Öğrenci Grupları","course_groups":"Öğrenci Grupları","groups":"Gruplar"},"tabs":{"everyone":"Herkes"}}}}},"uk":{"groups":{"manage":{"group_categories":{"account_group_explanation":"Групи студентів рівня облікового запису - це гарний спосіб об\'єднання студентів без прив\'язки до конкретного курсу. Кожна студентська група отримує свій власний календар, форум для обговорень та засоби взаємодії для самоорганізації та підвищення ефективності спільної роботи.","course_group_explanation":"Студентські групи - це корисний спосіб організації студентів для таких видів діяльності, як групові проекти або документи. Кожна група студентів отримує свій власний календар, форум для обговорень та засоби співпраці для самоорганізації та підвищення ефективності спільної роботи.","group_assignment_instructions":"Ви можете випадковим чином розподіляти студентів по групах визначеного розміру або вручну створювати і організовувати групи.  Щойно групу створено,  ви можете налаштовувати завдання для \\"групового подання\\", тобто кожна група матиме одне подання для всіх користувачів цієї групи.","group_set":"Набір груп","headings":{"account_groups":"Студентські групи рівня облікового запису","course_groups":"Студентські групи","groups":"Групи"},"tabs":{"everyone":"Всі"}}}}},"zh-Hans":{"add_group_set_f9809e11":"添加小组集","groups":{"manage":{"group_categories":{"account_group_explanation":"帐户级学习小组是一种不依附特定课程而组织学生团体的良好方式。每个学习小组有自己的日历、讨论板和协作工具，从而能够更加有效地组织和合作。","course_group_explanation":"学习小组是组织学生开展团体项目或论文等工作的良好方式。每个学习小组有自己的日历、讨论板和协作工具，从而能够更加有效地组织和合作。","group_assignment_instructions":"您可以随机分配学生到指定规模的小组，或手动创建并组织小组。创建小组之后，您可以设置作业为 \\"小组作业\\" ，这意味着每个小组的所有学生只需提交一份共同的作业。","group_set":"小组集","headings":{"account_groups":"帐户级学习小组","course_groups":"学习小组","groups":"小组"},"tabs":{"everyone":"所有人"}}}}},"zh-Hant":{"add_group_set_f9809e11":"添加小組集合","groups":{"manage":{"group_categories":{"account_group_explanation":"帳戶級別的學生群組是一個用於組織學生的絕佳方式，並且不會將其綁定到特定的課程。每一個學生群組都有其自己的月曆、討論板和協作工具，所以他們能夠更有效地組織起來，共同努力。","course_group_explanation":"學生群組是出於群組專案或論文等事項組織學生的有效途徑。每一個學生群組都有其自己的月曆、討論板和協作工具，所以他們能夠更有效地組織起來，共同努力。","group_assignment_instructions":"您可以隨機指派學生到特定規模的群組，或手動創建和組織群組。在創建了群組之後，可以設置作業為『群組提交件』作業，這意味著每個群組都將有一個針對該群組的所有使用者提交件。","group_set":"群組設置","headings":{"account_groups":"帳戶級別的學生群組","course_groups":"學生群組","groups":"群組"},"tabs":{"everyone":"所有人"}}}}}}'))
